import React from 'react';

import { Header } from '../../components/Header/';
import { Background } from '../../components/Background';

import './index.css';


const Home = () => {
    return(
        <>
            <div className="container">
                <Header/>
                <div className="background">
                    <Background/>
                </div>
            </div>
        </>
    )
}

export default Home;
